About Us 👇🏾

With over 7 million members…

Color Of Change is the largest online force taking action on behalf of Black people in America. Both corporations and our government make decisions every day that impact Black people and our communities. With our members’ needs and voices leading the charge, we fight to hold decision-makers accountable, and win changes that matter: in the criminal justice system, in the media, in the workplace, in the economy, in our democracy, everywhere.  

Founded in response to Hurricane Katrina…

where government officials failed to meet even the most basic needs of Black people in crisis, and where the media promoted unfair, inaccurate, and dehumanizing images of Black people to rationalize it – our purpose is to make the voice of our community both un-ignorable, and powerful enough to change the system. If we act together strategically, creatively, and collaboratively, we believe creating a less hostile and more human world for Black people – and all people – is possible. 

