Why should you attend? 

This event is going to leave you feeling empowered, confident and stronger than before. As a team Dr. Nick Torres and I are bringing 18+ of experience in helping others achieve success. The techniques we’ve used and implemented into our programs have worked on thousands of clients and patients. 

What to expect? 

Our class is going to feel like an educational fitness party instead of a workout. Think about it: group fitness is a social activity. You get the support, encouragement, and motivation of your fellow participants. There’s a knowledgeable instructor helping you get a great physical workout. There’s awesome music pumping through the speakers, fresh air, good weather, sun. What more can you ask for? I’ll wait 🧏🏾

You’d be surprised how the party-like elements of group fitness can make an hour pass so much faster than an hour on a treadmill. And just to be clear I’m not promoting eliminating the treadmill. Making fitness fun is key to increasing exercise adherence (meaning you’ll work out more often) which means you’ll see results faster!

